INSERT INTO "Clinics" ("id", "name", "address", "descriptionHTML", "descriptionMarkdown", "image", "createdAt", "updatedAt") VALUES
(2, 'Bênh viện đại học Duy Tân Đà Nẵng', '216 Phan Châu Trinh, Hòa An, Cẩm Lệ, Đà Nẵng', '<p><strong>Địa chỉ:</strong>  Bệnh viện có nhiều cổng, bệnh nhân đến khám sẽ đến cổng:</p>y<ul><li>Số 16 - 18 Phủ Doãn, Hoàn Kiếm, Hà Nội</li></ul><p><strong>Thời gian làm việc</strong>:</p><ul><li>Thứ 2 đến thứ 7</li><li>Sáng: 7h00 - 12h00</li><li>Chiều: 13h30 - 16h30</li></ul><p>Bệnh viện Việt Đức là một trong 5 bệnh viện tuyến Trung ương, hạng đặc biệt của Việt Nam. Bệnh viện có lịch sử trên 100 năm, bề dày truyền thống danh tiếng, là cái nôi của ngành ngoại khoa Việt Nam gắn liền với những thành tựu Y học quan trọng của đất nước.</p><p>Việt Đức là địa chỉ uy tín hàng đầu về ngoại khoa, tiến hành khám bệnh, chữa bệnh và thực hiện các kỹ thuật chụp chiếu, xét nghiệm, thăm dò chức năng cơ bản và chuyên sâu hàng ngày cho người dân.</p><p>Bệnh viện có đội ngũ y bác sĩ hùng hậu, nhiều người kiêm là cán bộ giảng dạy tại Đại học Y khoa Hà Nội hoặc Khoa Y Dược - Đại học Quốc gia Hà Nội. Trong số họ nhiều người là chuyên gia đầu ngành và bác sĩ giàu kinh nghiệm ở các chuyên khoa khác nhau.</p><p><strong>Lưu ý quan trọng</strong></p><p>Bệnh viện có nhiều khu khám bệnh, do đó để thuận tiện và tiết kiệm thời gian khi đi khám, người bệnh nên tìm hiểu kĩ về vị trí khu khám bệnh của mình trước khi đi khám.Bệnh viện Hữu nghị Việt Đức là bệnh viện chuyên về Ngoại khoa, vì vậy, lịch các bác sĩ thường linh động và ưu tiên khám cho các ca cấp cứu.Người bệnh nên chủ động chuẩn bị một số câu hỏi liên quan đến tình trạng của mình trước khi đi khám để hành trình khám bệnh được hiệu quả hơn.Chi phí khám</p><p><strong>Người bệnh có thể lựa chọn một trong các gói khám sau:</strong></p><ul><li>Gói 1:</li></ul><p>Khám Giáo sư, Phó Giáo sư, Tiến sĩ, Bác sĩ Chuyên khoa II - Chi phí 500.000 đồng/lần khámKhám với bác sĩ Trưởng khoa hoặc Phó khoa - Chi phí 500.000 đồng/lần khám</p><ul><li>Gói 2:</li></ul><p>Khám Thạc sĩ, Bác sĩ Chuyên khoa I - Chi phí: 300.000 đồng/lần khám</p>', '**Địa chỉ:**  Bệnh viện có nhiều cổng, bệnh nhân đến khám sẽ đến cổng: * Số 16 - 18 Phủ Doãn, Hoàn Kiếm, Hà Nội**Thời gian làm việc**: * Thứ 2 đến thứ 7* Sáng: 7h00 - 12h00* Chiều: 13h30 - 16h30Bệnh viện Việt Đức là một trong 5 bệnh viện tuyến Trung ương, hạng đặc biệt của Việt Nam. Bệnh viện có lịch sử trên 100 năm, bề dày truyền thống danh tiếng, là cái nôi của ngành ngoại khoa Việt Nam gắn liền với những thành tựu Y học quan trọng của đất nước. Việt Đức là địa chỉ uy tín hàng đầu về ngoại khoa, tiến hành khám bệnh, chữa bệnh và thực hiện các kỹ thuật chụp chiếu, xét nghiệm, thăm dò chức năng cơ bản và chuyên sâu hàng ngày cho người dân. Bệnh viện có đội ngũ y bác sĩ hùng hậu, nhiều người kiêm là cán bộ giảng dạy tại Đại học Y khoa Hà Nội hoặc Khoa Y Dược - Đại học Quốc gia Hà Nội. Trong số họ nhiều người là chuyên gia đầu ngành và bác sĩ giàu kinh nghiệm ở các chuyên khoa khác nhau. **Lưu ý quan trọng**Bệnh viện có nhiều khu khám bệnh, do đó để thuận tiện và tiết kiệm thời gian khi đi khám, người bệnh nên tìm hiểu kĩ về vị trí khu khám bệnh của mình trước khi đi khám.Bệnh viện Hữu nghị Việt Đức là bệnh viện chuyên về Ngoại khoa, vì vậy, lịch các bác sĩ thường linh động và ưu tiên khám cho các ca cấp cứu.Người bệnh nên chủ động chuẩn bị một số câu hỏi liên quan đến tình trạng của mình trước khi đi khám để hành trình khám bệnh được hiệu quả hơn.Chi phí khám**Người bệnh có thể lựa chọn một trong các gói khám sau:*** Gói 1:Khám Giáo sư, Phó Giáo sư, Tiến sĩ, Bác sĩ Chuyên khoa II - Chi phí 500.000 đồng/lần khámKhám với bác sĩ Trưởng khoa hoặc Phó khoa - Chi phí 500.000 đồng/lần khám* Gói 2:Khám Thạc sĩ, Bác sĩ Chuyên khoa I - Chi phí: 300.000 đồng/lần khám', 'data:image/jpeg;base64,', '2022-07-20 16:38:42', '2022-07-20 16:38:42');
INSERT INTO "Clinics" ("id", "name", "address", "descriptionHTML", "descriptionMarkdown", "image", "createdAt", "updatedAt") VALUES
(3, 'Phòng khám quân đội nhân dân', '71 Tôn Đản, Hòa An, Hà Nội', '<p>Bệnh viện Chợ Rẫy với lịch sử thành lập trên 100 năm, là bệnh viện hạng đặc biệt tuyến Trung ương lớn nhất cả nước với trên 1.800 giường và trên 3.000 kỹ thuật y tế được thực hiện. Hàng ngày Bệnh viện Chợ Rẫy tiếp nhận trung bình 6,000 -  8,000 bệnh nhân đến khám.</p><p>Bệnh viện Chợ Rẫy là bệnh viện đa khoa hoàn chỉnh, xếp hạng đặc biệt, tuyến kỹ thuật sau cùng các tỉnh thành phía Nam, trực thuộc Bộ Y tế. Thế mạnh nổi bật tại Bệnh viện Chợ Rẫy là sự kết hợp giữa các chuyên khoa mang lại hiệu quả tốt nhất trong việc chẩn đoán và điều trị cho người bệnh.</p><p><strong>Địa chỉ bệnh viện:</strong></p><p>201B Nguyễn Chí Thanh, Phường 12, Quận 5, Hồ Chí Minh</p><p><strong>Thời gian làm việc:</strong></p><p>Bệnh viện làm việc, tiếp nhận khám bệnh cho bệnh nhân ngoại trú từ thứ 2 đến thứ 7 hàng tuần:</p><ul><li>Thứ 2 đến thứ 6: từ 7h – 16h</li><li>Thứ 7: từ 7h – 11h</li></ul>', 'Bệnh viện Chợ Rẫy với lịch sử thành lập trên 100 năm, là bệnh viện hạng đặc biệt tuyến Trung ương lớn nhất cả nước với trên 1.800 giường và trên 3.000 kỹ thuật y tế được thực hiện. Hàng ngày Bệnh viện Chợ Rẫy tiếp nhận trung bình 6,000 -  8,000 bệnh nhân đến khám.Bệnh viện Chợ Rẫy là bệnh viện đa khoa hoàn chỉnh, xếp hạng đặc biệt, tuyến kỹ thuật sau cùng các tỉnh thành phía Nam, trực thuộc Bộ Y tế. Thế mạnh nổi bật tại Bệnh viện Chợ Rẫy là sự kết hợp giữa các chuyên khoa mang lại hiệu quả tốt nhất trong việc chẩn đoán và điều trị cho người bệnh.**Địa chỉ bệnh viện:**201B Nguyễn Chí Thanh, Phường 12, Quận 5, Hồ Chí Minh**Thời gian làm việc:**Bệnh viện làm việc, tiếp nhận khám bệnh cho bệnh nhân ngoại trú từ thứ 2 đến thứ 7 hàng tuần:* Thứ 2 đến thứ 6: từ 7h – 16h* Thứ 7: từ 7h – 11h', 'data:image/jpeg;base64,', '2022-07-20 16:41:02', '2022-07-20 16:41:02');
