INSERT INTO "Markdowns" ("id", "contentHTML", "contentMarkdown", "description", "doctorId", "specialtyId", "clinicId", "createdAt", "updatedAt") VALUES
(1, '<p><strong>Bác sĩ chuyên khoa II NGUYEN Hana</strong></p><ul><li>Trưởng Khoa Dinh Dưỡng bệnh viện Da Liễu TP. HCM</li><li>Bác sĩ Hương có hơn 20 năm kinh nghiệm trong khám và điều trị bệnh lý da liễu</li><li>Bác sĩ nhận khám mọi độ tuổi</li></ul><p><strong>Quá trình công tác</strong></p><ul><li>Trưởng khoa Dinh Dưỡng, Bệnh viện Da Liễu TP.HCM</li><li>Nguyên Phó trưởng khoa Lâm sàng 1, Bệnh viện Da Liễu TP.HCM</li><li>Hiện là Bác sĩ Da liễu, Phòng khám Da liễu Táo Đỏ</li><li>Bác sĩ chuyên khoa da liễu, thẩm mỹ da Bệnh Viện Da Liễu TP.HCM</li></ul><p><strong>Quá trình đào tạo</strong></p><ul><li>Tốt nghiệp Bác sĩ Chuyên khoa II, chuyên ngành Da liễu, Đại học Y dược TP.HCM</li><li>Tốt nghiệp Bác sĩ Chuyên khoa I, chuyên ngành Da liễu, Đại học Y dược TP.HCM</li><li>Tốt nghiệp Bác sĩ Đa khoa, Đại học Y dược TP.HCM</li><li>Tham gia lớp Sơ bộ DInh dưỡng, Đại học Y khoa Phạm Ngọc Thạch</li><li>Thành viên các Hội khoa học, tổ chức chuyên môn</li><li>Hội viên chi hội Da Liễu Hồ Chí Minh</li><li>Hội viên Hội Da Liễu Việt Nam</li><li>Khám và điều trị</li></ul><p><strong>Bác sĩ khám và điều trị:</strong></p><ul><li>Mụn trứng cá: mụn viêm, bọc, nang, mụn đầu trắng, đâu đen</li><li>Nám, sạm da: nám, sạm da mặt</li><li>Rụng tóc, da dầu: mụn trứng cá, sẹo lồi, sẹo thâm, sẹo mụn</li><li>Mề đay: tóc gàu, vảy, rụng tóc từng phần, lan tỏa</li><li>Viêm da cơ địa: mảng da đỏ, ngứa nhiều, từng cơn</li><li>Viêm da dị ứng: mẩn đỏ da, ngứa, lan tỏa</li><li>Thủy đậu: mụn nước, ngứa, kèm sốt nhẹ, mệt mỏi</li><li>Zona: mang mụn nước, 1 bên người, đau nhức</li><li>Da nhờn, lỗ chân lông to</li><li>Vảy nến: mảng đổ da, tróc vảy, có thể toàn thân</li><li>Ghẻ ngứa: ngứa về đêm, vùng nếp, kẽ ngón tay, ngón chân</li><li>Rạn da: da đùi, da rạn teo, bụng, nếp bẹn, nách, lưng</li><li>Lão hóa da: da đổi màu, nhão, xệ, nến nhăn, sần</li><li>Da đồi mồi: đốm nâu</li><li>Pemphigus: bóng nước thân mình, niêm mạc</li><li>Lupus ban đỏ: hồng ban cánh bướm mặt, đau nhức mỏi cơ xương khớp</li><li>Xơ cứng bì: da cứng, không đều màu</li><li>Nấm da: da đỏ quằn quện, các vùng da, tóc, nếp da</li><li>Viêm da tiếp xúc: da đỏ, rát, nhạy cảm, tiếp xúc kiến ba khoang</li><li>Viêm da do nhiễm Corticoid, nhạy cảm: da đỏ, giãn mạch, mãng, nhạy cảm, nôi mụn</li><li>Nấm móng</li><li>Các bệnh lý da khác và bệnh lây qua đường quan hệ tình dục (STDs)</li></ul>', '**Bác sĩ chuyên khoa II NGUYEN Hana*** Trưởng Khoa Dinh Dưỡng bệnh viện Da Liễu TP. HCM* Bác sĩ Hương có hơn 20 năm kinh nghiệm trong khám và điều trị bệnh lý da liễu* Bác sĩ nhận khám mọi độ tuổi**Quá trình công tác*** Trưởng khoa Dinh Dưỡng, Bệnh viện Da Liễu TP.HCM* Nguyên Phó trưởng khoa Lâm sàng 1, Bệnh viện Da Liễu TP.HCM* Hiện là Bác sĩ Da liễu, Phòng khám Da liễu Táo Đỏ* Bác sĩ chuyên khoa da liễu, thẩm mỹ da Bệnh Viện Da Liễu TP.HCM**Quá trình đào tạo*** Tốt nghiệp Bác sĩ Chuyên khoa II, chuyên ngành Da liễu, Đại học Y dược TP.HCM* Tốt nghiệp Bác sĩ Chuyên khoa I, chuyên ngành Da liễu, Đại học Y dược TP.HCM* Tốt nghiệp Bác sĩ Đa khoa, Đại học Y dược TP.HCM* Tham gia lớp Sơ bộ DInh dưỡng, Đại học Y khoa Phạm Ngọc Thạch* Thành viên các Hội khoa học, tổ chức chuyên môn* Hội viên chi hội Da Liễu Hồ Chí Minh* Hội viên Hội Da Liễu Việt Nam* Khám và điều trị**Bác sĩ khám và điều trị:*** Mụn trứng cá: mụn viêm, bọc, nang, mụn đầu trắng, đâu đen* Nám, sạm da: nám, sạm da mặt* Rụng tóc, da dầu: mụn trứng cá, sẹo lồi, sẹo thâm, sẹo mụn* Mề đay: tóc gàu, vảy, rụng tóc từng phần, lan tỏa* Viêm da cơ địa: mảng da đỏ, ngứa nhiều, từng cơn* Viêm da dị ứng: mẩn đỏ da, ngứa, lan tỏa* Thủy đậu: mụn nước, ngứa, kèm sốt nhẹ, mệt mỏi* Zona: mang mụn nước, 1 bên người, đau nhức* Da nhờn, lỗ chân lông to* Vảy nến: mảng đổ da, tróc vảy, có thể toàn thân* Ghẻ ngứa: ngứa về đêm, vùng nếp, kẽ ngón tay, ngón chân* Rạn da: da đùi, da rạn teo, bụng, nếp bẹn, nách, lưng* Lão hóa da: da đổi màu, nhão, xệ, nến nhăn, sần* Da đồi mồi: đốm nâu* Pemphigus: bóng nước thân mình, niêm mạc* Lupus ban đỏ: hồng ban cánh bướm mặt, đau nhức mỏi cơ xương khớp* Xơ cứng bì: da cứng, không đều màu* Nấm da: da đỏ quằn quện, các vùng da, tóc, nếp da* Viêm da tiếp xúc: da đỏ, rát, nhạy cảm, tiếp xúc kiến ba khoang* Viêm da do nhiễm Corticoid, nhạy cảm: da đỏ, giãn mạch, mãng, nhạy cảm, nôi mụn* Nấm móng* Các bệnh lý da khác và bệnh lây qua đường quan hệ tình dục (STDs)', 'Trưởng Khoa Dinh Dưỡng bệnh viện Da Liễu Đà NẵngNguyên Phó trưởng khoa Lâm sàng 1, Bệnh viện Da Liễu Đà NẵngBác sĩ Hương có hơn 20 năm kinh nghiệm trong khám và điều trị bệnh lý da liễuBác sĩ nhận khám mọi độ tuổi', 6, NULL, NULL, '2022-07-11 08:38:00', '2022-07-21 12:17:36'),
(2, '<p><strong>Bác sĩ chuyên khoa II NGUYEN Hana</strong></p><ul><li>Trưởng Khoa Dinh Dưỡng bệnh viện Da Liễu TP. HCM</li><li>Bác sĩ Hương có hơn 20 năm kinh nghiệm trong khám và điều trị bệnh lý da liễu</li><li>Bác sĩ nhận khám mọi độ tuổi</li></ul><p><strong>Quá trình công tác</strong></p><ul><li>Trưởng khoa Dinh Dưỡng, Bệnh viện Da Liễu TP.HCM</li><li>Nguyên Phó trưởng khoa Lâm sàng 1, Bệnh viện Da Liễu TP.HCM</li><li>Hiện là Bác sĩ Da liễu, Phòng khám Da liễu Táo Đỏ</li><li>Bác sĩ chuyên khoa da liễu, thẩm mỹ da Bệnh Viện Da Liễu TP.HCM</li></ul><p><strong>Quá trình đào tạo</strong></p><ul><li>Tốt nghiệp Bác sĩ Chuyên khoa II, chuyên ngành Da liễu, Đại học Y dược TP.HCM</li><li>Tốt nghiệp Bác sĩ Chuyên khoa I, chuyên ngành Da liễu, Đại học Y dược TP.HCM</li><li>Tốt nghiệp Bác sĩ Đa khoa, Đại học Y dược TP.HCM</li><li>Tham gia lớp Sơ bộ DInh dưỡng, Đại học Y khoa Phạm Ngọc Thạch</li><li>Thành viên các Hội khoa học, tổ chức chuyên môn</li><li>Hội viên chi hội Da Liễu Hồ Chí Minh</li><li>Hội viên Hội Da Liễu Việt Nam</li><li>Khám và điều trị</li></ul><p><strong>Bác sĩ khám và điều trị:</strong></p><ul><li>Mụn trứng cá: mụn viêm, bọc, nang, mụn đầu trắng, đâu đen</li><li>Nám, sạm da: nám, sạm da mặt</li><li>Rụng tóc, da dầu: mụn trứng cá, sẹo lồi, sẹo thâm, sẹo mụn</li><li>Mề đay: tóc gàu, vảy, rụng tóc từng phần, lan tỏa</li><li>Viêm da cơ địa: mảng da đỏ, ngứa nhiều, từng cơn</li><li>Viêm da dị ứng: mẩn đỏ da, ngứa, lan tỏa</li><li>Thủy đậu: mụn nước, ngứa, kèm sốt nhẹ, mệt mỏi</li><li>Zona: mang mụn nước, 1 bên người, đau nhức</li><li>Da nhờn, lỗ chân lông to</li><li>Vảy nến: mảng đổ da, tróc vảy, có thể toàn thân</li><li>Ghẻ ngứa: ngứa về đêm, vùng nếp, kẽ ngón tay, ngón chân</li><li>Rạn da: da đùi, da rạn teo, bụng, nếp bẹn, nách, lưng</li><li>Lão hóa da: da đổi màu, nhão, xệ, nến nhăn, sần</li><li>Da đồi mồi: đốm nâu</li><li>Pemphigus: bóng nước thân mình, niêm mạc</li><li>Lupus ban đỏ: hồng ban cánh bướm mặt, đau nhức mỏi cơ xương khớp</li><li>Xơ cứng bì: da cứng, không đều màu</li><li>Nấm da: da đỏ quằn quện, các vùng da, tóc, nếp da</li><li>Viêm da tiếp xúc: da đỏ, rát, nhạy cảm, tiếp xúc kiến ba khoang</li><li>Viêm da do nhiễm Corticoid, nhạy cảm: da đỏ, giãn mạch, mãng, nhạy cảm, nôi mụn</li><li>Nấm móng</li><li>Các bệnh lý da khác và bệnh lây qua đường quan hệ tình dục (STDs)</li></ul>', '**Bác sĩ chuyên khoa II NGUYEN Hana*** Trưởng Khoa Dinh Dưỡng bệnh viện Da Liễu TP. HCM* Bác sĩ Hương có hơn 20 năm kinh nghiệm trong khám và điều trị bệnh lý da liễu* Bác sĩ nhận khám mọi độ tuổi**Quá trình công tác*** Trưởng khoa Dinh Dưỡng, Bệnh viện Da Liễu TP.HCM* Nguyên Phó trưởng khoa Lâm sàng 1, Bệnh viện Da Liễu TP.HCM* Hiện là Bác sĩ Da liễu, Phòng khám Da liễu Táo Đỏ* Bác sĩ chuyên khoa da liễu, thẩm mỹ da Bệnh Viện Da Liễu TP.HCM**Quá trình đào tạo*** Tốt nghiệp Bác sĩ Chuyên khoa II, chuyên ngành Da liễu, Đại học Y dược TP.HCM* Tốt nghiệp Bác sĩ Chuyên khoa I, chuyên ngành Da liễu, Đại học Y dược TP.HCM* Tốt nghiệp Bác sĩ Đa khoa, Đại học Y dược TP.HCM* Tham gia lớp Sơ bộ DInh dưỡng, Đại học Y khoa Phạm Ngọc Thạch* Thành viên các Hội khoa học, tổ chức chuyên môn* Hội viên chi hội Da Liễu Hồ Chí Minh* Hội viên Hội Da Liễu Việt Nam* Khám và điều trị**Bác sĩ khám và điều trị:*** Mụn trứng cá: mụn viêm, bọc, nang, mụn đầu trắng, đâu đen* Nám, sạm da: nám, sạm da mặt* Rụng tóc, da dầu: mụn trứng cá, sẹo lồi, sẹo thâm, sẹo mụn* Mề đay: tóc gàu, vảy, rụng tóc từng phần, lan tỏa* Viêm da cơ địa: mảng da đỏ, ngứa nhiều, từng cơn* Viêm da dị ứng: mẩn đỏ da, ngứa, lan tỏa* Thủy đậu: mụn nước, ngứa, kèm sốt nhẹ, mệt mỏi* Zona: mang mụn nước, 1 bên người, đau nhức* Da nhờn, lỗ chân lông to* Vảy nến: mảng đổ da, tróc vảy, có thể toàn thân* Ghẻ ngứa: ngứa về đêm, vùng nếp, kẽ ngón tay, ngón chân* Rạn da: da đùi, da rạn teo, bụng, nếp bẹn, nách, lưng* Lão hóa da: da đổi màu, nhão, xệ, nến nhăn, sần* Da đồi mồi: đốm nâu* Pemphigus: bóng nước thân mình, niêm mạc* Lupus ban đỏ: hồng ban cánh bướm mặt, đau nhức mỏi cơ xương khớp* Xơ cứng bì: da cứng, không đều màu* Nấm da: da đỏ quằn quện, các vùng da, tóc, nếp da* Viêm da tiếp xúc: da đỏ, rát, nhạy cảm, tiếp xúc kiến ba khoang* Viêm da do nhiễm Corticoid, nhạy cảm: da đỏ, giãn mạch, mãng, nhạy cảm, nôi mụn* Nấm móng* Các bệnh lý da khác và bệnh lây qua đường quan hệ tình dục (STDs)', 'Trưởng Khoa Dinh Dưỡng bệnh viện Da Liễu Đà NẵngNguyên Phó trưởng khoa Lâm sàng 1, Bệnh viện Da Liễu Đà NẵngBác sĩ Hương có hơn 20 năm kinh nghiệm trong khám và điều trị bệnh lý da liễuBác sĩ nhận khám mọi độ tuổi', 6, NULL, NULL, '2022-07-11 08:38:20', '2022-07-21 12:17:36'),
(3, '<p><strong>Phó Giáo sư, Tiến sĩ, Bác sĩ Iu Ben</strong></p><ul><li>Phó Giáo sư, Tiến sĩ chuyên ngành Tai Mũi Họng</li><li>Nguyên Trưởng khoa Tai Mũi Họng trẻ em, Bệnh viện Tai Mũi Họng Trung ương</li><li>Trên 25 năm công tác tại Bệnh viện Tai Mũi Họng Trung ương</li><li>Bác sĩ Nội trú chuyên ngành Tai Mũi Họng</li><li>Bác sĩ đã từng tu nghiệp Cộng hòa Pháp về Tai Mũi Họng</li></ul><p><strong>Khám &amp; điều trị</strong></p><ul><li>Chuyên khám và điều trị các bệnh lý Tai Mũi Họng người lớn</li><li>Chuyên khám và điều trị các bệnh lý Tai Mũi Họng trẻ em</li></ul><p><strong>Nội soi Tai Mũi Họng</strong></p><ul><li>Thực hiện các qui trình kỹ thuật Tai Mũi Họng</li></ul><p><strong>Các bệnh về tai</strong></p><ul><li>Ù tai, nghe kém, điếc đột ngột</li><li>Chẩy mủ tai, viêm tai giữa cấp, mạn</li><li>Vá màng nhĩ nội soi</li><li>Phát hiện sớm và điều trị tốt bệnh viêm tai giữa màng nhĩ đóng kín, không chẩy mủ ra ngoài</li></ul><p><strong>Các bệnh mũi xoang</strong></p><ul><li>Viêm mũi xoang dị ứng, viêm mũi vận mạch</li><li>Viêm mũi ngạt tắc mũi mạn tính</li><li>Viêm đa xoang mạn lâu ngày khó khỏi, polyp mũi xoang</li><li>Nấm mũi xoang</li><li>Đau đầu mạn tính do mũi xoang…</li><li>Các bệnh về họng thanh quản</li><li>Ở trẻ em viêm VA, viêm mũi họng mạn tính</li><li>Các biến chứng của viêm VA (như viêm tai thanh dịch, viêm tai giữa cấp, viêm thanh khí phế quản….)</li><li>Viêm amiđan cấp, mạn</li><li>Nạo V.A</li><li>Cắt Amidan</li></ul>', '**Phó Giáo sư, Tiến sĩ, Bác sĩ Iu Ben*** Phó Giáo sư, Tiến sĩ chuyên ngành Tai Mũi Họng* Nguyên Trưởng khoa Tai Mũi Họng trẻ em, Bệnh viện Tai Mũi Họng Trung ương* Trên 25 năm công tác tại Bệnh viện Tai Mũi Họng Trung ương* Bác sĩ Nội trú chuyên ngành Tai Mũi Họng* Bác sĩ đã từng tu nghiệp Cộng hòa Pháp về Tai Mũi Họng**Khám & điều trị*** Chuyên khám và điều trị các bệnh lý Tai Mũi Họng người lớn* Chuyên khám và điều trị các bệnh lý Tai Mũi Họng trẻ em**Nội soi Tai Mũi Họng*** Thực hiện các qui trình kỹ thuật Tai Mũi Họng**Các bệnh về tai*** Ù tai, nghe kém, điếc đột ngột* Chẩy mủ tai, viêm tai giữa cấp, mạn* Vá màng nhĩ nội soi* Phát hiện sớm và điều trị tốt bệnh viêm tai giữa màng nhĩ đóng kín, không chẩy mủ ra ngoài**Các bệnh mũi xoang*** Viêm mũi xoang dị ứng, viêm mũi vận mạch* Viêm mũi ngạt tắc mũi mạn tính* Viêm đa xoang mạn lâu ngày khó khỏi, polyp mũi xoang* Nấm mũi xoang* Đau đầu mạn tính do mũi xoang…* Các bệnh về họng thanh quản* Ở trẻ em viêm VA, viêm mũi họng mạn tính* Các biến chứng của viêm VA (như viêm tai thanh dịch, viêm tai giữa cấp, viêm thanh khí phế quản….)* Viêm amiđan cấp, mạn* Nạo V.A* Cắt Amidan', 'Nguyên Trưởng khoa Tai mũi họng trẻ em, Bệnh viện Tai Mũi Họng Trung ươngTrên 25 năm công tác tại Bệnh viện Tai mũi họng Trung ươngChuyên khám và điều trị các bệnh lý Tai Mũi Họng người lớn và trẻ em', 5, NULL, NULL, '2022-07-11 11:12:53', '2022-07-21 12:17:43'),
(4, '<p><strong>Bác sĩ Chuyên khoa II Nguyễn Thị Kim Loan</strong></p><ul><li>Nguyên Trưởng khoa Cơ Xương Khớp và Nội tổng hợp Bệnh viện E Hà Nội</li><li>Được phong tặng Danh hiệu thầy thuốc Ưu tú</li><li>Từng là thực tập sinh tại Ucraina</li><li>Bác sĩ khám cho người bệnh từ 16 tuổi trở lên</li></ul><p><strong>Quá trình đào tạo</strong></p><ul><li>Tốt nghiệp Đại học Y Hà Nội (1970)</li><li>Tốt nghiệp Bác sĩ Chuyên khoa II, Học viện Quân Y (1997)</li></ul><p><strong>Quá trình công tác</strong></p><ul><li>Làm việc tại khoa cơ xương khớp và Nội tổng hợp Bệnh viện E Hà Nội</li><li>Nguyên Trưởng khoa cơ xương khớp và Nội tổng hợp Bệnh viện E Hà Nội</li></ul><p><strong>Giải thưởng</strong></p><ul><li>Danh hiệu thầy thuốc Ưu tú</li><li>Chiến sĩ thi đua ngành y tế</li></ul><p><strong>Khám và điều trị</strong></p><ul><li>Bệnh về Khớp</li><li>Gout, Viêm cột sống dính khớp, thoái hóa khớp, viêm khoanh khớp vai</li><li>Đau khớp vai, đau vai gáy, Lupus ban đỏ, đau thắt lưng, đau xương khớp</li><li>Thoát vị đĩa đệm, viêm khớp</li></ul><p><strong>Bệnh về Xương</strong></p><p>Loãng xương, đau nhức xươngViêm xương, gai xương, vôi hóa cột sốngChấn thương thể thao<strong>Bệnh về Cơ</strong></p><p>Chứng đau mỏi cơYếu cơ, Loạn dưỡng cơViêm cơ, Teo cơ<strong>Các triệu chứng - biểu hiện sau:</strong></p><ul><li>Thoái hóa khớp (khớp gối, cột sống thắt lưng, cột sống cổ)</li><li>Loãng xương</li><li>Đau vai gáy, Đau thắt lưng, Đau gối, Đau háng, Đau cột sống cổ, Đau hông</li><li>Đau cổ chân, Đau khủy tay, Đau bàn tay, cổ tay, Đau các ngón tay</li><li>Đau khớp thái dương hàm</li><li>Đau lưng, Đau vai, Đau các ngón chân, Đau cổ chân, bàn chân</li><li>Đau thần kinh tọa</li><li>Thoát vị đĩa đệm cột sống cổ, cột sống thắt lưng</li><li>Đau cánh tay</li><li>Hội chứng vai tay, Hội chứng cổ vai cánh tay</li><li>Đau thần kinh liên sườn, Đau ngực, Đau sụn ức sườn,Viêm sụn ức sườn, Đau bả vai</li><li>Bệnh Gout</li><li>Viêm khớp dạng thấp, Viêm đa khớp, Viêm gân</li><li>Đau nhiều khớp</li><li>Hoại tử vô khuẩn chỏm xương đùi, Hoại tử vô mạch</li><li>Đau xương bánh chè</li><li>Luput ban đỏ hệ thống, Lulus ban đỏ hệ thống</li><li>Xơ cứng bì toàn thân</li><li>Viêm đa cơ, Viêm da cơ, tổn thương da</li><li>Viêm khớp vùng chậu</li><li>Viêm khớp thiếu niên (đi khập khiễng)</li><li>Viêm khớp nhiễm khuẩn</li><li>Viêm màng hoạt dịch (khớp gối, háng, cổ chân, khớp khủy)</li><li>Viêm cột sống dính khớp</li><li>Loạn dưỡng cơ tiến triển</li></ul>', '**Bác sĩ Chuyên khoa II Nguyễn Thị Kim Loan*** Nguyên Trưởng khoa Cơ Xương Khớp và Nội tổng hợp Bệnh viện E Hà Nội* Được phong tặng Danh hiệu thầy thuốc Ưu tú* Từng là thực tập sinh tại Ucraina* Bác sĩ khám cho người bệnh từ 16 tuổi trở lên**Quá trình đào tạo*** Tốt nghiệp Đại học Y Hà Nội (1970)* Tốt nghiệp Bác sĩ Chuyên khoa II, Học viện Quân Y (1997)**Quá trình công tác*** Làm việc tại khoa cơ xương khớp và Nội tổng hợp Bệnh viện E Hà Nội* Nguyên Trưởng khoa cơ xương khớp và Nội tổng hợp Bệnh viện E Hà Nội**Giải thưởng*** Danh hiệu thầy thuốc Ưu tú* Chiến sĩ thi đua ngành y tế**Khám và điều trị*** Bệnh về Khớp* Gout, Viêm cột sống dính khớp, thoái hóa khớp, viêm khoanh khớp vai* Đau khớp vai, đau vai gáy, Lupus ban đỏ, đau thắt lưng, đau xương khớp* Thoát vị đĩa đệm, viêm khớp**Bệnh về Xương**Loãng xương, đau nhức xươngViêm xương, gai xương, vôi hóa cột sốngChấn thương thể thao**Bệnh về Cơ**Chứng đau mỏi cơYếu cơ, Loạn dưỡng cơViêm cơ, Teo cơ**Các triệu chứng - biểu hiện sau:*** Thoái hóa khớp (khớp gối, cột sống thắt lưng, cột sống cổ)* Loãng xương* Đau vai gáy, Đau thắt lưng, Đau gối, Đau háng, Đau cột sống cổ, Đau hông* Đau cổ chân, Đau khủy tay, Đau bàn tay, cổ tay, Đau các ngón tay* Đau khớp thái dương hàm* Đau lưng, Đau vai, Đau các ngón chân, Đau cổ chân, bàn chân* Đau thần kinh tọa* Thoát vị đĩa đệm cột sống cổ, cột sống thắt lưng* Đau cánh tay* Hội chứng vai tay, Hội chứng cổ vai cánh tay* Đau thần kinh liên sườn, Đau ngực, Đau sụn ức sườn,Viêm sụn ức sườn, Đau bả vai* Bệnh Gout* Viêm khớp dạng thấp, Viêm đa khớp, Viêm gân* Đau nhiều khớp* Hoại tử vô khuẩn chỏm xương đùi, Hoại tử vô mạch* Đau xương bánh chè* Luput ban đỏ hệ thống, Lulus ban đỏ hệ thống* Xơ cứng bì toàn thân* Viêm đa cơ, Viêm da cơ, tổn thương da* Viêm khớp vùng chậu* Viêm khớp thiếu niên (đi khập khiễng)* Viêm khớp nhiễm khuẩn* Viêm màng hoạt dịch (khớp gối, háng, cổ chân, khớp khủy)* Viêm cột sống dính khớp* Loạn dưỡng cơ tiến triển', 'Nguyên Trưởng khoa Cơ xương khớp, Bệnh viện E Hà NộiĐược phong tặng Danh hiệu Thầy thuốc Ưu túBác sĩ khám cho người bệnh từ 16 tuổi trở lên', 4, NULL, NULL, '2022-07-19 17:04:02', '2022-07-21 12:41:28'),
(5, '<p><strong>Tiến sĩ, Bác sĩ Trịnh Thị Khanh</strong></p><ul><li>Nguyên Phó Trưởng khoa Thần kinh, Bệnh viện Hữu Nghị</li><li>Hơn 32 năm kinh nghiệm trong lĩnh vực Thần kinh</li></ul><p><strong>Quá trình đào tạo</strong></p><ul><li>Tốt nghiệp Tiến sĩ y khoa (2004)</li><li>Tốt nghiệp Thạc sĩ (1996)</li><li>Bác sĩ Chuyên khoa cấp I, Trường Đại học Y Hà Nội (1987)</li><li>Tốt nghiệp Đại học y Hà Nội (1984)</li></ul><p><strong>Quá trình công tác</strong></p><ul><li>Phó Trưởng khoa Thần kinh, Bệnh viện Hữu Nghị (2007 – 2014)</li><li>Phó Trưởng khoa Cấp cứu, Bệnh viện Hữu Nghị (2003 – 2007)</li><li>Từng công tác tại khoa Hồi sức cấp cứu bệnh viện Hữu Nghị</li><li>Từng công tác tại khoa Khám chữa bệnh bệnh viện Hữu Nghị</li></ul><p><strong>Khám và điều trị</strong></p><ul><li>Các bệnh đau đầu: Chứng đau nửa đầu, đau đầu căn nguyên mạch máu, đau đầu mạn tính hàng ngày,..</li><li>Bệnh đau vai gáy do thoái hóa cột sống cổ, thoát vị đĩa đệm cột sống cổ, …</li><li>Đau thắt lưng hông do thoái hóa, thoát vị, đau do viêm khớp cùng chậu…</li><li>Rối loạn tiền đình</li><li>Điều trị chóng mặt do thiếu máu não</li><li>Tư vấn và điều trị các bệnh lý rối loạn về giấc ngủ: mất ngủ cấp tính hoặc mạn tính</li><li>Liệt dây 7 ngoại vi: Viêm các dây thần kinh sọ não và các dây thần kinh ngoại vi khác như hội chứng ống cổ tay, đau vai khuỷu tay do chơi thể thao</li><li>Liệt nửa người do nhồi máu não</li><li>Các bệnh lý về sa sút trí tuệ: Suy giảm nhận thức nhẹ, suy giảm trí nhớ, sa sút trí tuệ nguyên nhân mạch máu (sa sút trí tuệ sau đột quỵ),Alzheimer</li><li>Bệnh rối loạn vận động như bệnh Parkinson</li></ul>', '**Tiến sĩ, Bác sĩ Trịnh Thị Khanh*** Nguyên Phó Trưởng khoa Thần kinh, Bệnh viện Hữu Nghị* Hơn 32 năm kinh nghiệm trong lĩnh vực Thần kinh**Quá trình đào tạo*** Tốt nghiệp Tiến sĩ y khoa (2004)* Tốt nghiệp Thạc sĩ (1996)* Bác sĩ Chuyên khoa cấp I, Trường Đại học Y Hà Nội (1987)* Tốt nghiệp Đại học y Hà Nội (1984)**Quá trình công tác*** Phó Trưởng khoa Thần kinh, Bệnh viện Hữu Nghị (2007 – 2014)* Phó Trưởng khoa Cấp cứu, Bệnh viện Hữu Nghị (2003 – 2007)* Từng công tác tại khoa Hồi sức cấp cứu bệnh viện Hữu Nghị* Từng công tác tại khoa Khám chữa bệnh bệnh viện Hữu Nghị**Khám và điều trị*** Các bệnh đau đầu: Chứng đau nửa đầu, đau đầu căn nguyên mạch máu, đau đầu mạn tính hàng ngày,..* Bệnh đau vai gáy do thoái hóa cột sống cổ, thoát vị đĩa đệm cột sống cổ, …* Đau thắt lưng hông do thoái hóa, thoát vị, đau do viêm khớp cùng chậu…* Rối loạn tiền đình* Điều trị chóng mặt do thiếu máu não* Tư vấn và điều trị các bệnh lý rối loạn về giấc ngủ: mất ngủ cấp tính hoặc mạn tính* Liệt dây 7 ngoại vi: Viêm các dây thần kinh sọ não và các dây thần kinh ngoại vi khác như hội chứng ống cổ tay, đau vai khuỷu tay do chơi thể thao* Liệt nửa người do nhồi máu não* Các bệnh lý về sa sút trí tuệ: Suy giảm nhận thức nhẹ, suy giảm trí nhớ, sa sút trí tuệ nguyên nhân mạch máu (sa sút trí tuệ sau đột quỵ),Alzheimer* Bệnh rối loạn vận động như bệnh Parkinson', 'Nguyên Phó Trưởng khoa Thần kinh, Bệnh viện Hữu NghịNguyên Phó Trưởng khoa Hồi sức cấp cứu, Bệnh viện Hữu NghịHơn 32 năm kinh nghiệm trong lĩnh vực Thần kinh', 3, NULL, NULL, '2022-07-20 12:07:00', '2022-07-21 12:40:37'),
(6, '<p><strong>Phó Giáo sư, Tiến sĩ, Bác sĩ Cao cấp Vũ Hoàng</strong></p><ul><li>Phó giáo sư, Tiến sĩ, Bác sĩ cao cấp chuyên khoa Da liễu</li><li>Bác sĩ từng công tác tại Bệnh viện Da liễu Trung ương</li><li>Nguyên Trưởng phòng chỉ đạo tuyến tại Bệnh viện Da liễu Trung ương</li><li>Đạt chứng chỉ Diploma về Da liễu tại Viện da liễu Băng Cốc - Thái Lan</li><li>Bác sĩ thường xuyên tham gia các Hội thảo, Hội nghị Quốc tế về Da liễu</li><li>Tổng thư ký hội Da liễu Việt Nam</li><li>Hội viên của Hội Da liễu Đông Nam Á, Châu Á và Thế giới</li><li>Giảng viên bộ môn Da liễu tại Đại Học Y Hà Nội</li><li>Trưởng Bộ môn Da liễu, Trường Đại học Kinh doanh và Công nghệ</li><li>Tốt nghiệp Đại học Y Hà Nội (1977)</li></ul><p><strong>Phó Giáo sư khám và điều trị</strong></p><ul><li>Các bệnh lý về chuyên sâu về da liễu người lớn và trẻ em</li><li>Trứng cá thông thường thanh thiếu niên, người lớn, trứng cá do thuốc, mỹ phẩm, do bôi corticord, các thể bệnh trứng cá nặng, trứng cá đỏ (rosacea)</li><li>Điều trị da phục hồi da tổn hại do trứng cá, sẹo trứng cá</li><li>Các bệnh lý da mặt: viêm da dị ứng, tổn hại da do sử dụng mỹ phẩm, do corticord, lão hóa da</li><li>Nám da, tàn nhang, sạm da, các bệnh da tăng sắc tố sau viêm, sau trứng cá, do mỹ phẩm</li><li>Viêm da cơ địa trẻ em và người lớn</li><li>Viêm da dị ứng, viêm da tiếp xúc, viêm da dầu</li><li>Tổ đỉa</li><li>Mày đay</li><li>Bạch biến</li><li>Vảy nến</li><li>Rụng tóc</li><li>Các bệnh da do nhiễm khuẩn: Viêm nang lông, chốc, nhọt, viêm da mủ</li><li>Zona, Thủy đậu, Herpes</li><li>Ghẻ</li><li>Các bênh da do nấm: Nấm nông da, nấm da đầu, nấm móng tay, móng chân, lang ben, nấm men niêm mạc</li><li>Viêm mao mạch dị ứng</li><li>các bệnh da: Có bọng nước, bệnh vẩy phấn hồng, á vẩy nến, liken phẳng, các bệnh da dị ứng thuốc</li><li>U lành tính của da: Đồi mồi, u cổ tuyến mồ hôi, u mềm lây, u mềm treo, u tuyến bã</li><li>Một số bệnh lông - tóc - móng</li><li>Chăm sóc da (skincare)  cho viêm da mặt, trứng cá, liệu trình trị nám, lăn kim, huyết tương giàu tiểu cầu, trị sẹo trứng cá, laser, plasma trị u lành da, nám, đồi mồi</li><li>Tiêm tái sinh nang tóc</li></ul>', '**Phó Giáo sư, Tiến sĩ, Bác sĩ Cao cấp Vũ Hoàng*** Phó giáo sư, Tiến sĩ, Bác sĩ cao cấp chuyên khoa Da liễu* Bác sĩ từng công tác tại Bệnh viện Da liễu Trung ương* Nguyên Trưởng phòng chỉ đạo tuyến tại Bệnh viện Da liễu Trung ương* Đạt chứng chỉ Diploma về Da liễu tại Viện da liễu Băng Cốc - Thái Lan* Bác sĩ thường xuyên tham gia các Hội thảo, Hội nghị Quốc tế về Da liễu* Tổng thư ký hội Da liễu Việt Nam* Hội viên của Hội Da liễu Đông Nam Á, Châu Á và Thế giới* Giảng viên bộ môn Da liễu tại Đại Học Y Hà Nội* Trưởng Bộ môn Da liễu, Trường Đại học Kinh doanh và Công nghệ* Tốt nghiệp Đại học Y Hà Nội (1977)**Phó Giáo sư khám và điều trị*** Các bệnh lý về chuyên sâu về da liễu người lớn và trẻ em* Trứng cá thông thường thanh thiếu niên, người lớn, trứng cá do thuốc, mỹ phẩm, do bôi corticord, các thể bệnh trứng cá nặng, trứng cá đỏ (rosacea)* Điều trị da phục hồi da tổn hại do trứng cá, sẹo trứng cá* Các bệnh lý da mặt: viêm da dị ứng, tổn hại da do sử dụng mỹ phẩm, do corticord, lão hóa da* Nám da, tàn nhang, sạm da, các bệnh da tăng sắc tố sau viêm, sau trứng cá, do mỹ phẩm* Viêm da cơ địa trẻ em và người lớn* Viêm da dị ứng, viêm da tiếp xúc, viêm da dầu* Tổ đỉa* Mày đay* Bạch biến* Vảy nến* Rụng tóc* Các bệnh da do nhiễm khuẩn: Viêm nang lông, chốc, nhọt, viêm da mủ* Zona, Thủy đậu, Herpes* Ghẻ* Các bênh da do nấm: Nấm nông da, nấm da đầu, nấm móng tay, móng chân, lang ben, nấm men niêm mạc* Viêm mao mạch dị ứng* các bệnh da: Có bọng nước, bệnh vẩy phấn hồng, á vẩy nến, liken phẳng, các bệnh da dị ứng thuốc* U lành tính của da: Đồi mồi, u cổ tuyến mồ hôi, u mềm lây, u mềm treo, u tuyến bã* Một số bệnh lông - tóc - móng* Chăm sóc da (skincare)  cho viêm da mặt, trứng cá, liệu trình trị nám, lăn kim, huyết tương giàu tiểu cầu, trị sẹo trứng cá, laser, plasma trị u lành da, nám, đồi mồi* Tiêm tái sinh nang tóc', 'Nguyên Trưởng phòng chỉ đạo tuyến tại Bệnh viện Da liễu Trung ươngBác sĩ từng công tác tại Bệnh viện Da liễu Trung ươngTổng thư ký hội Da liễu Việt Nam', 2, NULL, NULL, '2022-07-21 12:10:25', '2022-07-21 12:40:43');
