INSERT INTO "Specialties" ("id", "name", "descriptionHTML", "descriptionMarkdown", "image", "createdAt", "updatedAt") VALUES
(2, 'Cơ xương khớp', '<p><strong><h3>Cơ Xương Khớp</h3></strong></p><p><strong>Bác sĩ Cơ Xương Khớp giỏi</strong></p><ul><li>Danh sách các bác sĩ uy tín đầu ngành Cơ Xương Khớp tại Việt Nam:</li><li></li><li>Các chuyên gia có quá trình đào tạo bài bản, nhiều kinh nghiệm</li><li>Các giáo sư, phó giáo sư đang trực tiếp nghiên cứu và giảng dạy tại Đại học Y khoa Hà Nội</li><li>Các bác sĩ đã, đang công tác tại các bệnh viện hàng đầu Khoa Cơ Xương Khớp - Bệnh viện Bạch Mai, Bệnh viện Hữu nghị Việt Đức,Bệnh Viện E.</li><li>Là thành viên hoặc lãnh đạo các tổ chức chuyên môn như: Hiệp hội Cơ Xương Khớp, Hội Thấp khớp học,...</li><li>Được nhà nước công nhận các danh hiệu Thầy thuốc Nhân dân, Thầy thuốc Ưu tú, Bác sĩ Cao cấp,...</li></ul><p><strong>Bệnh Cơ Xương Khớp</strong></p><ul><li>Gout</li><li>Thoái hóa khớp: khớp gối, cột sống thắt lưng, cột sống cổ</li><li>Viêm khớp dạng thấp, Viêm đa khớp, Viêm gân</li><li>Tràn dịch khớp gối, Tràn dịch khớp háng, Tràn dịch khớp khủy, Tràn dịch khớp vai</li><li>Loãng xương, đau nhức xương</li><li>Viêm xương, gai xương</li><li>Viêm cơ, Teo cơ, chứng đau mỏi cơ</li><li>Yếu cơ, Loạn dưỡng cơ</li><li>Các chấn thương về cơ, xương, khớp</li></ul>', '#### **Cơ Xương Khớp****Bác sĩ Cơ Xương Khớp giỏi*** Danh sách các bác sĩ uy tín đầu ngành Cơ Xương Khớp tại Việt Nam:* * Các chuyên gia có quá trình đào tạo bài bản, nhiều kinh nghiệm* Các giáo sư, phó giáo sư đang trực tiếp nghiên cứu và giảng dạy tại Đại học Y khoa Hà Nội* Các bác sĩ đã, đang công tác tại các bệnh viện hàng đầu Khoa Cơ Xương Khớp - Bệnh viện Bạch Mai, Bệnh viện Hữu nghị Việt Đức,Bệnh Viện E.* Là thành viên hoặc lãnh đạo các tổ chức chuyên môn như: Hiệp hội Cơ Xương Khớp, Hội Thấp khớp học,...* Được nhà nước công nhận các danh hiệu Thầy thuốc Nhân dân, Thầy thuốc Ưu tú, Bác sĩ Cao cấp,...**Bệnh Cơ Xương Khớp*** Gout* Thoái hóa khớp: khớp gối, cột sống thắt lưng, cột sống cổ* Viêm khớp dạng thấp, Viêm đa khớp, Viêm gân* Tràn dịch khớp gối, Tràn dịch khớp háng, Tràn dịch khớp khủy, Tràn dịch khớp vai* Loãng xương, đau nhức xương* Viêm xương, gai xương* Viêm cơ, Teo cơ, chứng đau mỏi cơ* Yếu cơ, Loạn dưỡng cơ* Các chấn thương về cơ, xương, khớp', 'data:image/jpeg;base64,', '2022-07-18 17:28:53', '2022-07-18 17:28:53');
INSERT INTO "Specialties" ("id", "name", "descriptionHTML", "descriptionMarkdown", "image", "createdAt", "updatedAt") VALUES
(3, 'Thần kinh', '<p><strong><h3>Thần Kinh</h3></strong></p><p><strong>Bác sĩ Thần kinh giỏi</strong></p><ul><li>Danh sách các giáo sư, bác sĩ chuyên khoa Thần kinh giỏi:</li><li>Các giáo sư, bác sĩ uy tín đầu ngành chuyên khoa Thần kinh đã và đang công tác tại các bệnh viện lớn như: Bệnh viện Bạch Mai, Bệnh viện Việt Đức, Bệnh viện 108, Bệnh viện Đại học Y Hà Nội, Bệnh viện 103.</li><li>Là thành viên hoặc lãnh đạo các tổ chức chuyên môn như: Hội Thần kinh Việt Nam, Hội Phẫu thuật Thần kinh...</li><li>Được nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp.</li></ul><p><strong>Khám bệnh chuyên khoa Thần kinh</strong></p><ul><li>Bại Não</li><li>Đau đầu, chóng mặt, buồn nôn</li><li>Bệnh Pakison, bệnh tiền đình</li><li>Bị co cơ, căng dây thần kinh</li><li>Động kinh, có những cơn vãng ý thức</li><li>Bị tê bì nửa mặt, chèn dây thần kinh</li><li>Bồn chồn, lo lắng, hồi hộp, chân tay run</li><li>Có dấu hiệu tăng động</li><li>Co rút cổ, đau đầu với mặt, chân tay, vã mồ hôi</li><li>Chấn thương đầu, dây thần kinh</li></ul>', '#### **Thần Kinh****Bác sĩ Thần kinh giỏi*** Danh sách các giáo sư, bác sĩ chuyên khoa Thần kinh giỏi:* Các giáo sư, bác sĩ uy tín đầu ngành chuyên khoa Thần kinh đã và đang công tác tại các bệnh viện lớn như: Bệnh viện Bạch Mai, Bệnh viện Việt Đức, Bệnh viện 108, Bệnh viện Đại học Y Hà Nội, Bệnh viện 103.* Là thành viên hoặc lãnh đạo các tổ chức chuyên môn như: Hội Thần kinh Việt Nam, Hội Phẫu thuật Thần kinh...* Được nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp.**Khám bệnh chuyên khoa Thần kinh*** Bại Não   * Đau đầu, chóng mặt, buồn nôn   * Bệnh Pakison, bệnh tiền đình   * Bị co cơ, căng dây thần kinh       * Động kinh, có những cơn vãng ý thức   * Bị tê bì nửa mặt, chèn dây thần kinh* Bồn chồn, lo lắng, hồi hộp, chân tay run   * Có dấu hiệu tăng động    * Co rút cổ, đau đầu với mặt, chân tay, vã mồ hôi   * Chấn thương đầu, dây thần kinh', 'data:image/jpeg;base64,', '2022-07-18 17:30:06', '2022-07-18 17:30:06');
INSERT INTO "Specialties" ("id", "name", "descriptionHTML", "descriptionMarkdown", "image", "createdAt", "updatedAt") VALUES
(4, 'Tiêu hóa', '<p><strong><h3>Tiêu Hóa</h3></strong></p><p><strong>Bác sĩ Chuyên khoa Tiêu hóa</strong></p><ul><li>Danh sách các bác sĩ Tiêu hóa uy tín đầu ngành tại Việt Nam:</li><li>Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên ngành Tiêu hóa tại Hà Nội</li><li>Các giáo sư, phó giáo sư là giảng viên Đại học Y khoa Hà Nội</li><li>Các bác sĩ đã, đang công tác tại các bệnh viện hàng đầu như Bệnh viện Bạch Mai, Bệnh Viện Việt Đức, Bệnh Viện Nhi Trung ương, Bệnh viện Y học Cổ truyền Việt Nam...</li><li>Được nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp,...</li></ul><p><strong>Tư vấn, khám và điều trị các Bệnh Tiêu hóa</strong></p><ul><li>Ăn uống kém, không ngon</li><li>Rối loạn tiêu hóa, táo bón, trĩ</li><li>Nhiễm vi khuẩn HP (Helicobacter pylori)</li><li>Nội soi dạ dày, đại tràng, tiêu hóa</li><li>Buồn nôn, chướng bụng, đầy bụng ợ chua, đầy hơi</li><li>Co thắt thực quản, Hội chứng ruột kích thích</li><li>Đau bụng, dạ dày, đại tràng, thượng vị</li><li>Viêm đại tràng, dạ dày, tá tràng</li><li>Ung thư dạ dày, U nang tuyến tụy</li><li>Bệnh lý về gan, mật</li></ul>', '#### **Tiêu Hóa****Bác sĩ Chuyên khoa Tiêu hóa*** Danh sách các bác sĩ Tiêu hóa uy tín đầu ngành tại Việt Nam:* Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên ngành Tiêu hóa tại Hà Nội* Các giáo sư, phó giáo sư là giảng viên Đại học Y khoa Hà Nội* Các bác sĩ đã, đang công tác tại các bệnh viện hàng đầu như Bệnh viện Bạch Mai, Bệnh Viện Việt Đức, Bệnh Viện Nhi Trung ương, Bệnh viện Y học Cổ truyền Việt Nam...* Được nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp,...**Tư vấn, khám và điều trị các Bệnh Tiêu hóa*** Ăn uống kém, không ngon* Rối loạn tiêu hóa, táo bón, trĩ* Nhiễm vi khuẩn HP (Helicobacter pylori)* Nội soi dạ dày, đại tràng, tiêu hóa* Buồn nôn, chướng bụng, đầy bụng ợ chua, đầy hơi* Co thắt thực quản, Hội chứng ruột kích thích* Đau bụng, dạ dày, đại tràng, thượng vị* Viêm đại tràng, dạ dày, tá tràng* Ung thư dạ dày, U nang tuyến tụy* Bệnh lý về gan, mật', 'data:image/jpeg;base64,', '2022-07-18 17:31:43', '2022-07-18 17:31:43');
INSERT INTO "Specialties" ("id", "name", "descriptionHTML", "descriptionMarkdown", "image", "createdAt", "updatedAt") VALUES
(5, 'Tim mạch', '<p><strong><h3>Tim mạch</h3></strong></p><p><strong>Bác sĩ tim mạch giỏi</strong></p><ul><li>Danh dách các bác sĩ tim mạch uy tín đầu ngành tại Việt Nam:</li><li>Các chuyên gia được đào tạo bài bản về chuyên ngành Tim mạch tại các trường đại học trong nước và quốc tế.</li><li>Các giáo sư, phó giáo sư nghiên cứu và giảng dạy tại Đại học Y Hà Nội</li><li>Các bác sĩ đã, đang công tác tại các bệnh viện hàng đầu như Viện Tim Mạch Quốc Gia, Bệnh viện Bạch Mai, Bệnh viện Việt Đức, Bệnh Viện E, Bệnh Viện Tim Hà Nội</li><li>Là thành viên hoặc lãnh đạo các tổ chức chuyên môn như: Hiệp hội Tim Mạch Việt Nam</li><li>Đạt danh hiệu Thầy thuốc Nhân dân, Thầy thuốc Ưu tú, Bác sĩ Cao cấp,...</li></ul><p><strong>Khám tư vấn tim mạch</strong></p><ul><li>Khó thở, Đau ngực, đau tim</li><li>Tăng huyết áp, hạ huyết áp</li><li>Rối loạn mỡ máu, cao huyết áp, chóng mặt</li><li>Bệnh van tim (Hẹp hở van tim), Hẹp động mạch chủ</li><li>Cảm giác hồi hộp, tim đập nhanh</li><li>Tim bẩm sinh, có tiền sử bệnh tim to, tiền sử tai biến</li><li>Đã đặt stent tim, nong động mạch vành</li><li>Giãn tĩnh mạch chân</li></ul>', '#### **Tim mạch****Bác sĩ tim mạch giỏi*** Danh dách các bác sĩ tim mạch uy tín đầu ngành tại Việt Nam:* Các chuyên gia được đào tạo bài bản về chuyên ngành Tim mạch tại các trường đại học trong nước và quốc tế.* Các giáo sư, phó giáo sư nghiên cứu và giảng dạy tại Đại học Y Hà Nội* Các bác sĩ đã, đang công tác tại các bệnh viện hàng đầu như Viện Tim Mạch Quốc Gia, Bệnh viện Bạch Mai, Bệnh viện Việt Đức, Bệnh Viện E, Bệnh Viện Tim Hà Nội* Là thành viên hoặc lãnh đạo các tổ chức chuyên môn như: Hiệp hội Tim Mạch Việt Nam* Đạt danh hiệu Thầy thuốc Nhân dân, Thầy thuốc Ưu tú, Bác sĩ Cao cấp,...**Khám tư vấn tim mạch*** Khó thở, Đau ngực, đau tim* Tăng huyết áp, hạ huyết áp* Rối loạn mỡ máu, cao huyết áp, chóng mặt* Bệnh van tim (Hẹp hở van tim), Hẹp động mạch chủ* Cảm giác hồi hộp, tim đập nhanh   * Tim bẩm sinh, có tiền sử bệnh tim to, tiền sử tai biến   * Đã đặt stent tim, nong động mạch vành* Giãn tĩnh mạch chân', 'data:image/jpeg;base64,', '2022-07-18 17:32:53', '2022-07-18 17:32:53');
INSERT INTO "Specialties" ("id", "name", "descriptionHTML", "descriptionMarkdown", "image", "createdAt", "updatedAt") VALUES
(6, 'Tai mũi họng', '<p><strong><h3>Tai Mũi Họng</h3></strong></p><p><strong>Bác sĩ Chuyên khoa Tai Mũi Họng</strong></p><ul><li>Danh sách các bác sĩ uy tín đầu ngành tại Việt Nam:</li><li>Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên ngành Tai Mũi Họng tại Hà Nội</li><li>Các giáo sư, phó giáo sư là giảng viên Đại học Y khoa Hà Nội</li><li>Các bác sĩ đã, đang công tác tại các bệnh viện hàng đầu như Bệnh viện Bạch Mai, Bệnh Viện Tai Mũi Họng Trung ương, Bệnh viện Quân Y 108...</li><li>Được nhà nước công nhận các danh hiệu Thầy thuốc Nhân dân, Thầy thuốc Ưu tú, Bác sĩ cao cấp,...</li></ul><p><strong>Các bệnh Tai Mũi Họng</strong></p><ul><li>Ù tai, đau tai, chảy máu tai</li><li>Thủng màng nhĩ, điếc đột ngột</li><li>Viêm tai giữa</li><li>Amidan, V.A</li><li>Viêm xoang</li><li>Nghẹt mũi</li><li>Hay bị chảy máu cam</li><li>Đau cổ họng, khó nuốt</li><li>Ho kéo dài</li><li>Ngủ ngáy</li></ul>', '#### **Tai Mũi Họng****Bác sĩ Chuyên khoa Tai Mũi Họng*** Danh sách các bác sĩ uy tín đầu ngành tại Việt Nam:* Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên ngành Tai Mũi Họng tại Hà Nội* Các giáo sư, phó giáo sư là giảng viên Đại học Y khoa Hà Nội* Các bác sĩ đã, đang công tác tại các bệnh viện hàng đầu như Bệnh viện Bạch Mai, Bệnh Viện Tai Mũi Họng Trung ương, Bệnh viện Quân Y 108...* Được nhà nước công nhận các danh hiệu Thầy thuốc Nhân dân, Thầy thuốc Ưu tú, Bác sĩ cao cấp,...**Các bệnh Tai Mũi Họng*** Ù tai, đau tai, chảy máu tai* Thủng màng nhĩ, điếc đột ngột* Viêm tai giữa* Amidan, V.A* Viêm xoang* Nghẹt mũi* Hay bị chảy máu cam* Đau cổ họng, khó nuốt* Ho kéo dài* Ngủ ngáy', 'data:image/jpeg;base64,', '2022-07-18 17:34:01', '2022-07-18 17:34:01');
INSERT INTO "Specialties" ("id", "name", "descriptionHTML", "descriptionMarkdown", "image", "createdAt", "updatedAt") VALUES
(7, 'Châm cứu', '<p><strong><h3>Châm cứu</h3></strong></p><p><strong>Bác sĩ Châm cứu giỏi</strong></p><ul><li>Bác sĩ Y học Cổ truyền uy tín đầu ngành tại Việt Nam:</li><li>Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên khoa Y học Cổ truyền</li><li>Các bác sĩ đã, đang công tác tại chuyên Khoa Y học Cổ truyền - Bệnh viện Y học Cổ truyền Trung ương, Bệnh viện Bạch Mai, Thanh Nhàn..</li><li>Được nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp,..</li></ul><p><strong>Tư vấn, khám và điều trị các vấn đề:</strong></p><ul><li>Bệnh lý thần kinh: đau đầu, mất ngủ, suy nhược thần kinh...</li><li>Bệnh lý cơ xương khớp: đau mỏi tay chân, thoái hóa khớp, viêm khớp...</li><li>Bệnh lý tim mạch: Tăng huyết áp, huyết áp thấp, đau thắt ngực...</li><li>Bệnh lý đường tiêu hóa: đau bụng, rối loạn chức năng tiêu hóa...</li></ul>', '#### **Châm cứu****Bác sĩ Châm cứu giỏi*** Bác sĩ Y học Cổ truyền uy tín đầu ngành tại Việt Nam:* Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên khoa Y học Cổ truyền* Các bác sĩ đã, đang công tác tại chuyên Khoa Y học Cổ truyền - Bệnh viện Y học Cổ truyền Trung ương, Bệnh viện Bạch Mai, Thanh Nhàn..* Được nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp,..**Tư vấn, khám và điều trị các vấn đề:*** Bệnh lý thần kinh: đau đầu, mất ngủ, suy nhược thần kinh...* Bệnh lý cơ xương khớp: đau mỏi tay chân, thoái hóa khớp, viêm khớp...* Bệnh lý tim mạch: Tăng huyết áp, huyết áp thấp, đau thắt ngực...* Bệnh lý đường tiêu hóa: đau bụng, rối loạn chức năng tiêu hóa...', 'data:image/jpeg;base64,', '2022-07-18 17:34:43', '2022-07-18 17:34:43');
INSERT INTO "Specialties" ("id", "name", "descriptionHTML", "descriptionMarkdown", "image", "createdAt", "updatedAt") VALUES
(8, 'Y học cổ truyền', '<p><strong><h3>Y Học Cổ Truyền</h3></strong></p><p><strong>Bác sĩ Y học Cổ truyền giỏi</strong></p><ul><li>Danh sách các bác sĩ Y học Cổ truyền uy tín đầu ngành tại Việt Nam:</li><li>Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên khoa Y học Cổ truyền</li><li>Các bác sĩ đã, đang công tác tại chuyên Khoa Y học Cổ truyền - Bệnh viện Y học Cổ truyền Trung ương, Bệnh viện Bạch Mai, Thanh Nhàn..</li><li>Được nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp,..</li></ul><p><strong>Tư vấn, khám và điều trị các vấn đề:</strong></p><ul><li>Bệnh lý thần kinh: đau đầu, mất ngủ, suy nhược thần kinh...</li><li>Bệnh lý cơ xương khớp: đau mỏi tay chân, thoái hóa khớp, viêm khớp...</li><li>Bệnh lý tim mạch: Tăng huyết áp, huyết áp thấp, đau thắt ngực...</li><li>Bệnh lý đường tiêu hóa: đau bụng, rối loạn chức năng tiêu hóa...</li></ul>', '#### **Y Học Cổ Truyền****Bác sĩ Y học Cổ truyền giỏi*** Danh sách các bác sĩ Y học Cổ truyền uy tín đầu ngành tại Việt Nam:* Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên khoa Y học Cổ truyền* Các bác sĩ đã, đang công tác tại chuyên Khoa Y học Cổ truyền - Bệnh viện Y học Cổ truyền Trung ương, Bệnh viện Bạch Mai, Thanh Nhàn..* Được nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp,..**Tư vấn, khám và điều trị các vấn đề:*** Bệnh lý thần kinh: đau đầu, mất ngủ, suy nhược thần kinh...* Bệnh lý cơ xương khớp: đau mỏi tay chân, thoái hóa khớp, viêm khớp...* Bệnh lý tim mạch: Tăng huyết áp, huyết áp thấp, đau thắt ngực...* Bệnh lý đường tiêu hóa: đau bụng, rối loạn chức năng tiêu hóa...', 'data:image/jpeg;base64,', '2022-07-18 17:38:13', '2022-07-18 17:38:13');
INSERT INTO "Specialties" ("id", "name", "descriptionHTML", "descriptionMarkdown", "image", "createdAt", "updatedAt") VALUES
(9, 'Da liễu', '<p><strong><h3>Da liễu</h3></strong></p><p><strong>Bác sĩ Chuyên khoa Da liễu</strong></p><ul><li>BookingCare cung cấp thông tin và lịch khám của các bác sĩ chuyên khoa da liễu giỏi tại Hà Nội.</li><li>Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn tại Hà Nội như: Bệnh viện Da liễu Trung ương, Bệnh viện Da liễu Hà Nội</li></ul><p><strong>Khám và điều trị</strong></p><ul><li>Bệnh vẩy nến, Da khô, Ngứa da</li><li>Rám tàn nhang</li><li>Mụn cóc sinh dục</li><li>Nấm cơ thể, Nấm da đầu</li><li>Nấm móng tay, móng chân</li><li>Rụng tóc, hói đầu</li><li>Viêm da dị ứng, Viêm da tiếp xúc, Viêm da tiết bã</li><li>Viêm nang lông</li><li>Xơ cứng bì</li><li>Zona thần kinh</li></ul>', '#### **Da liễu****Bác sĩ Chuyên khoa Da liễu*** BookingCare cung cấp thông tin và lịch khám của các bác sĩ chuyên khoa da liễu giỏi tại Hà Nội.* Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn tại Hà Nội như: Bệnh viện Da liễu Trung ương, Bệnh viện Da liễu Hà Nội**Khám và điều trị*** Bệnh vẩy nến, Da khô, Ngứa da* Rám tàn nhang* Mụn cóc sinh dục* Nấm cơ thể, Nấm da đầu* Nấm móng tay, móng chân* Rụng tóc, hói đầu* Viêm da dị ứng, Viêm da tiếp xúc, Viêm da tiết bã* Viêm nang lông* Xơ cứng bì* Zona thần kinh', 'data:image/jpeg;base64,', '2022-07-18 17:40:17', '2022-07-18 17:40:17');
